import React from 'react';
import './Climb.css';
import userLogo from './user-logo.svg';
import shoeLogo from './shoe-logo.svg';
import likeIcon from './like-icon.svg';
import commentIcon from './comment-icon.svg';



const Climb = ({climbList}, {addLike}) => {
  const handleClick = (event) => {
    event.preventDefault();
    props.addLike(climb);

  }
    return climbList.map((climb, index) => (
      <div className='climb-container'> 
        <div className='climb-data-container'>
          <img src={userLogo} className='user-logo' alt='user logo'/>

          <div>
            <div className='climb-data-heading'>
              {climb.username}
            </div>
            <div className='climb-data-container'>
              <div className='climb-data'>
                {climb.date}
              </div>
              |
              <div className='climb-data'>
                {climb.gym}
              </div>
            </div>

          </div>

        </div>
        <div className='climb-data-container'>
          <img src={shoeLogo} className = 'user-logo' alt='climbing shoe'/>

          <div className='climb-data'>
              {climb.climbType}
          </div>
          |
          <div className='climb-data'>
            {climb.grade}
          </div>
          |
          <div className='climb-data'>
            {climb.rating}
          </div>


        </div>

        <div className='button-container'> 
          Likes: {climb.likes}
          <button className='button' onClick={handleClick}> 
            <img src={likeIcon} className='icon' alt='like'/>
          </button>
          <button className='button'> 
            <img src={commentIcon} className='icon' alt='comment'/>
          </button>

        </div>






      </div>

      ));



};

export default Climb;
